(1160, 205, '267615_320220_description', 'Many technology organizations have segmented Sales and Marketing with the intent to provide greater accountability and specialization. The element of segmentation that is often overlooked is bridging the marketing and sales organization to generate the greatest unified results. The three greatest ways to accomplish this is through goal sharing, tools and metrics, and communicating a clear vision. This presentation will address those strategies backed with real-world use cases of how they have succeeded in unifying the Sales and Marketing functions for tech businesses.'),
