(1197, 262, 'v_description', '<p class=\"tx1\">The Conference Center is our vibrant business meeting and event facility that is just across the street from the WSCC. Events can be planned in either space or can span both spaces, which allows us to accommodate any size meeting, from executive retreats to multi-floor trade shows.</p>\r\n<p class=\"tx2\">The Washington State Convention Center is conveniently located in downtown Seattle at 705 Pike Street. Our main entrance is on the corner of 7th Avenue and Pike Street. Additional information can be found on the venue website below.</p>'),
