(232, 1, '2018-12-03 09:28:47', '2018-12-03 09:28:47', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum', 'CIO Emerging Technologies Summit', '', 'publish', 'closed', 'closed', '', 'cio-emerging-technologies-summit-2', '', '', '2019-02-01 11:17:24', '2019-02-01 11:17:24', '', 0, 'http://localhost/abhijitda/event/cio-emerging-technologies-summit-2/', 0, 'event_listing', '', 0),
(246, 1, '2018-12-07 06:33:19', '2018-12-07 06:33:19', '', 'about_us', '', 'inherit', 'open', 'closed', '', 'about_us', '', '', '2018-12-07 06:33:27', '2018-12-07 06:33:27', '', 0, 'http://localhost/abhijitda/wp-content/uploads/2018/12/about_us.jpg', 0, 'attachment', 'image/jpeg', 0),
(247, 1, '2018-12-07 06:52:02', '2018-12-07 06:52:02', '[vc_section][vc_row el_class=\"about_and_giving_back_outer\"][vc_column][rev_slider_vc alias=\"about-giving-back-banner\" enable_paspartu=\"no\" el_class=\"about_giving_banner\"][/vc_column][/vc_row][/vc_section][vc_section][vc_row][vc_column][vc_column_text]\r\n<div class=\"about_text\">\r\n<p class=\"predictera-text-cobtent\">Predictera is an event management firm specializing in engaging C-level executives from fortune 500 companies and startup organizations with the cutting edge Big Data/Virtual Reality/IOT vendor companies. Our summits focuses on delivering strategic opportunities to network and engage with c-level executives in national and local organizations focusing on a variety of industry verticals</p>\r\n\r\n</div>\r\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column width=\"1/2\"][vc_row_inner][vc_column_inner][vc_column_text]\r\n<p class=\"we-wish-text\">We with to help organizations get a different perspective of the challenges they are facing, with the ultimate goal of enhancing their business. We recognize that sharing our experiences enriches all of us.</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_custom_heading text=\"VISION\" font_container=\"tag:h3|text_align:left\" el_class=\"vision-custom\"][vc_column_text]\r\n<p class=\"vision-text\">To be an indispensable tool in North American companies utilizing big data, Data Science, and Analytics by 2020.</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner][vc_custom_heading text=\"MISSION\" font_container=\"tag:h3|text_align:left\" el_class=\"mission_custom\"][vc_column_text]\r\n<p class=\"mission-text\">Predictra is aimed at bringing together C-level executives, Movers and Shakers in the field of Big Data, Augmented Reality, IoT and Analytics.</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][vc_column width=\"1/2\"][vc_video][/vc_column][/vc_row][/vc_section][vc_section][vc_row][vc_column][vc_row_inner][vc_column_inner][vc_custom_heading text=\"HOW WE \'RE DIFFRENCE\" font_container=\"tag:h4|text_align:left\"][vc_custom_heading text=\"Giving Back\"][vc_column_text]\r\n<p class=\"giving-back-text\">Predictera is committed to giving back to the community and devote ourselves to noble causes. We contribute a portion of our margin towards extensive research into congenital foot deformity causes.</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row][vc_column width=\"1/2\"][vc_custom_heading text=\"Support\" font_container=\"tag:h3|text_align:left\"][vc_column_text]\r\n<p class=\"suppor-text-content\">Our Primary goal is to provide financial resources needed to create and support high-quality lower limb deformity camps nationally. Support includes: Providing treatment supplies, braces, establishing systems to collect and analyze patient data and camps related data to monitor quality and measure impact.</p>\r\n[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_single_image img_size=\"480*250\"][/vc_column][/vc_row][vc_row][vc_column width=\"1/2\"][vc_single_image img_size=\"480*250\"][/vc_column][vc_column width=\"1/2\"][vc_custom_heading text=\"Research\"][vc_column_text]\r\n<p class=\"research-text-con\">Our Long-term goal is focused on supporting Helping Pod (Non-profit Org) to work closely with the Health institutions and other Non-profit organizations for doing extensive study in understanding the patterns of foot deformity and to build an AI based product that can proactively predict the symptoms of the deformity during pregnancy stage.</p>\r\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column width=\"1/2\"][vc_custom_heading text=\"3D Printing\"][vc_column_text]\r\n<p class=\"3d-printing-content\">Our mid-term goal is to focus on 3D printing design &amp; research of physical models for addressing the functional needs of the childrens foot. 3D printing has the ability to replicate near-exact 1:1 physical models of a patients problem area. This allows the orthopedic surgeons to practice the procedure as well as examine the foot in further detail prior to the complicated surgery.</p>\r\n[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_single_image img_size=\"480*250\"][/vc_column][/vc_row][/vc_section]', 'About & Giving Back', '', 'publish', 'closed', 'closed', '', 'about-giving-back', '', '', '2018-12-12 08:35:18', '2018-12-12 08:35:18', '', 0, 'http://localhost/abhijitda/?page_id=247', 0, 'page', '', 0),
(248, 1, '2018-12-07 06:52:02', '2018-12-07 06:52:02', '<p>[vc_section][vc_row el_class=\"about_and_giving_back_outer\"][vc_column][rev_slider_vc alias=\"about-giving-back-banner\" enable_paspartu=\"no\" el_class=\"about_giving_banner\"][/vc_column][/vc_row][/vc_section][vc_section][vc_row][vc_column][/vc_column][/vc_row][/vc_section]</p>\r\n', 'About & Giving Back', '', 'inherit', 'closed', 'closed', '', '247-revision-v1', '', '', '2018-12-07 06:52:02', '2018-12-07 06:52:02', '', 247, 'http://localhost/abhijitda/2018/12/07/247-revision-v1/', 0, 'revision', '', 0);
